import Footer from '../components/layout/Footer';
import Header from '../components/layout/Header';
import MainHome from '../components/MainHome';

const Home = (props) => {
  return (
    <>
      <Header />
      <MainHome />
      <Footer />
    </>
  );
}

export default Home;
